import React, { useEffect } from "react";
import { Col } from "react-bootstrap";
import axios from "axios";

const getAllMovies = async () => {
  const res = await axios.get(
    "https://api.themoviedb.org/3/movie/popular?api_key=52ef927bbeb21980cd91386a29403c78&l&language=ar"
  );
  console.log(res);
};

function CardMovie() {
  useEffect(() => {
    getAllMovies();
  }, []);
  return (
    <Col xs="6" sm="6" md="4" lg="6" className="my-1">
      <div className="card">
        <img src="habib.jpeg" className="card_image" alt="habib" />
        <div className="card_overlay">
          <div className="overlay_text text-center w-100 p-2">
            <p>اسم الفيلم iron man</p>
            <p>تاريخ الاصدار : 30/11/2012</p>
            <p>النوع: خيال علمي</p>
            <p>التقييم: 8.5</p>
          </div>
        </div>
      </div>
    </Col>
  );
}

export default CardMovie;
